import * as api from '../api';

// Action creators
const getStyles = () => async (dispatch) => {
    try {
        const { data } = await api.fetchStyles();
        dispatch(action);
    } catch (error) {

    }
    const action = { type: 'FETCH_ALL', payload: [] }
    dispatch(action);
}
